import React, { Component } from "react";
import "./style.css"
import { Link } from "react-router-dom";

export class Main_page extends Component {
    render() {
        return (
            <>
                <p>Доступные страницы</p>
                <div className="links">
                    <div><Link className="link" href="">hello</Link></div>
                    <div><a className="link" href="">count</a></div>
                    <div><a className="link" href="">query</a></div>
                </div>
            </>
        )
    }
}
